INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (0, "", 100, 40000, 0, 1, 8, 36, 0, "", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 150, 40001, 0, 1, 8, 37, 107501, "ぺコリーヌ", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 150, 40001, 0, 2, 8, 38, 107601, "コッコロ", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 150, 40001, 0, 3, 8, 39, 107801, "キャル", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 150, 40001, 0, 4, 8, 40, 107701, "スズメ", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 150, 40001, 0, 5, 8, 41, 107901, "タマキ", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 150, 40001, 0, 6, 8, 42, 107501, "ぺコリーヌ", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 150, 40001, 0, 7, 8, 43, 107601, "コッコロ", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 150, 40001, 0, 8, 8, 44, 107801, "キャル", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 150, 40001, 0, 9, 8, 45, 107701, "スズメ", 91002);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 150, 40001, 0, 10, 8, 46, 107901, "タマキ", 91002);
