INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 40011, 0, 1, 2, 321, 125801, "リリ", 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 40011, 0, 2, 2, 322, 126001, "クリア", 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, "んーと。\nこれ、あげる。\nはい", 1, 40011, 0, 3, 2, 323, 126101, "プレシア", 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 40011, 0, 4, 2, 324, 125801, "リリ", 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 40011, 0, 5, 2, 325, 126001, "クリア", 24001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, "お兄。\nきてくれて、うれしい", 1, 40011, 0, 6, 2, 326, 126101, "プレシア", 24001);
